import { Injectable } from '@angular/core';

const ENDPOINT = 'http://localhost/tpeAngular/api/albums';

@Injectable({
  providedIn: 'root'
})
export class TechDataService {

  constructor(private http: HttpClient) { }

  public getAll() {
    this.http.get(ENDPOINT);
  }


}
